import React , {useContext} from 'react'
import { providerContext } from './component/MyContecest'
import UseRef from './component/UseRef';

const App = () => {
  const {val } = useContext(providerContext);

  return (
    <div>
      {val.name}
      <UseRef/>
    </div>
  )
}

export default App
